import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-3c74d92e776a9",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Blog\\vuepressblog\\docs\\README.md").then(comp => {
        Vue.component("v-3c74d92e776a9", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-47ee5d6412001",
    path: "/accumulate/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Blog\\vuepressblog\\docs\\accumulate\\README.md").then(comp => {
        Vue.component("v-47ee5d6412001", comp.default)
        next()
      })
    }
  },
  {
    path: "/accumulate/index.html",
    redirect: "/accumulate/"
  },
  {
    name: "v-1c0c62cf2db6b",
    path: "/algorithm/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Blog\\vuepressblog\\docs\\algorithm\\README.md").then(comp => {
        Vue.component("v-1c0c62cf2db6b", comp.default)
        next()
      })
    }
  },
  {
    path: "/algorithm/index.html",
    redirect: "/algorithm/"
  },
  {
    name: "v-55fed21c39808",
    path: "/guide.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Blog\\vuepressblog\\docs\\guide.md").then(comp => {
        Vue.component("v-55fed21c39808", comp.default)
        next()
      })
    }
  },
  {
    name: "v-1fe39aac221d2",
    path: "/others/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Blog\\vuepressblog\\docs\\others\\README.md").then(comp => {
        Vue.component("v-1fe39aac221d2", comp.default)
        next()
      })
    }
  },
  {
    path: "/others/index.html",
    redirect: "/others/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
